$(function () {
  $('.aa-survey-form').on('submit', function (e) {
    e.preventDefault();

    $('.modal-background').show();
    $('.aa-survey-errors').empty();

    $('.aa-select-container select').prop("disabled",
      $('.aa-select-container').css("display") === "none"
    );

    $('.aa-radio-container input').prop("disabled",
      $('.aa-radio-container').css("display") === "none"
    );

    $.ajax({
      url: '/api/surveys',
      method: 'POST',
      data: $(e.currentTarget).serialize(),
      success: function (survey) {
        window.location.replace('/surveys/thank_you');
      },
      error: function (xhr) {
        $('.modal-background').hide();

        if (xhr.status === 422) {
          var errors = xhr.responseJSON.errors;
          var $li;

          errors.forEach(function (error) {
            $li = $("<li></li>");
            $li.html(error);
            $('.aa-survey-errors').append($li);
          });
        }
        window.scrollTo(0, 0);
      }
    });
  });
});
